  const mesh = useRef()

return (
  <mesh
  {...props}
  ref={mesh}
  >
  <RoundedBox args={[0, 0, 0]} radius={0.5} smoothness={4} />
  <meshToonMaterial color={'#99582a'} />
  </mesh>

)
}

export default SeedBox
